def solve(n):

	arr = list(map(int,input().split()))
	if n == 1:
		return [-1]
	dp = [x + 1 for x in range(n)]

	for i in range(n - 1):
		if dp[i] == arr[i]:
			dp[i], dp[i+1] = dp[i+1], dp[i]
	if dp[-1] == arr[-1]:
		dp[-1], dp[-2] = dp[-2], dp[-1]
	return dp

for i in range(int(input())):
	print(*solve(int(input())))
